metadata.styles:
.certificate {
    width: 800px;
    margin: 0 auto;
    padding: 60px 80px;
    border: 10px solid #2c3e50;
    border-radius: 20px;
    background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
    color: white;
    font-family: 'Georgia', serif;
    text-align: center;
    box-shadow: 0 10px 30px rgba(0,0,0,0.3);
}

.header h1 {
    font-size: 48px;
    margin-bottom: 30px;
    font-weight: bold;
    text-shadow: 2px 2px 4px rgba(0,0,0,0.5);
    letter-spacing: 2px;
}

.content {
    margin: 40px 0;
}

.intro {
    font-size: 24px;
    margin-bottom: 20px;
    font-style: italic;
}

.student-name {
    font-size: 42px;
    margin: 30px 0;
    color: #f1c40f;
    text-shadow: 2px 2px 4px rgba(0,0,0,0.5);
    font-weight: bold;
    text-transform: uppercase;
    letter-spacing: 3px;
}

.completion-text {
    font-size: 20px;
    margin: 20px 0;
}

.course-name {
    font-size: 32px;
    margin: 25px 0;
    color: #ecf0f1;
    font-weight: bold;
    text-shadow: 1px 1px 2px rgba(0,0,0,0.5);
}

.batch-info, .level-info, .grade-info {
    font-size: 18px;
    margin: 15px 0;
}

.footer {
    margin-top: 50px;
    position: relative;
}

.signature-section {
    display: flex;
    justify-content: center;
    margin-bottom: 30px;
}

.signature {
    text-align: center;
    width: 250px;
}

.instructor-name {
    font-size: 20px;
    font-weight: bold;
    margin-bottom: 10px;
}

.signature-line {
    border: none;
    border-top: 2px solid white;
    width: 100%;
    margin: 10px 0;
}

.signature-label {
    font-size: 14px;
    font-style: italic;
}

.date {
    font-size: 16px;
    font-style: italic;
    position: absolute;
    bottom: 0;
    right: 0;
}

@media print {
    .certificate {
        border: 8px solid #2c3e50;
        box-shadow: none;
    }
}
